    function MStoTimestamp(ms) {
		var hours = ms / (1000 * 3600)
		hours = Math.floor(hours)
		ms = ms % (1000 * 3600)
		var minutes = ms / (1000 * 60)
		minutes = Math.floor(minutes)
		ms = ms % (1000 * 60)
		var seconds = ms / 1000
		seconds = Math.floor(seconds)
		ms = ms % (1000)
		
		return hours +":"+ minutes +":"+seconds +"."+ ms
	}
	
	function createDivs(chartIndex) {
		var chartDivID = "dashboard" + chartIndex;

		document.getElementById("chartArea").appendChild(linebreak);
		
		// parent node
		var thisDashboard = document.createElement("div");
		var red = Math.floor(Math.random() * 255);
		var blue = Math.floor(Math.random() * 255);
		var green = Math.floor(Math.random() * 255);
		var color = "rgba(" +red.toString() +", " + green.toString() + ", " + blue.toString() + ", .05)";
		thisDashboard.setAttribute("id", chartDivID);
		thisDashboard.setAttribute("style", "width: 90%; display: block; background-color: " + color +";");		
		document.getElementById("chartArea").appendChild(thisDashboard);
		
		// chart
		var thisChart = document.createElement("div");
		thisChart.setAttribute("id", chartDivID + "_chart");
		thisChart.setAttribute("style", "width: 100%;  display: block");
		thisDashboard.appendChild(thisChart);

    function drawVisualization(chartIndex) {
		/* We need to build the data table here. This is for a number of reasons related to the way google implemented their chart API.
		   firstly, if we are to have all of the data available here and then pick and choose what categories to include in our chart 
		   we cannot have the entire data set encapsulated within a function call to arrayToDataTable(...), it needs to be somewhere we can access it.
		   And we cannot just have it all within a 2D array, because then we couldn't use the annotatedTimeLine chart, which requires Date objects
		   for the X axis. Additionally, we wouldn't be able to add annotations anyway, because they are related to the google API, and javascripts
		   2D arrays would not understand the 'role:annotation' part.
		   
		   even more unfortunate is that for some reason google's chart API crashes if you create the google.visualization.DataTable
		   object outside of the drawVisualization() method. Maybe to do with the asynchronous nature of the library? I don't know, but the end
		   result is that this function is huge.
		*/		
		var displayTheseIndexes = [];
		displayTheseIndexes.push(0);
		displayTheseIndexes.push(1);
		displayTheseIndexes.push(2);
		
		for (var i = 0;i < chartDict[chartIndex].length;i++) {
			for (var index = 0; index < logging_data[0].length; index++) {
				if (logging_data[0][index] == chartDict[chartIndex.toString()][i]) {
					displayTheseIndexes.push(index * 2 + 1);	// need to change the index from the index in the logging_data_table
																// to the one created in data table with annotations
					displayTheseIndexes.push(index * 2 + 2);	// also need to add the tooltip
					
					break;
				}
			}
		}

		var newChart = true;	// store if this is a new chart, if it is,
								// we need to add an element to the list of control bars, if not edit the one already there
		var chartDivID = "dashboard" + chartIndex;
		if (document.getElementById(chartDivID) == null) {		// change background colors?
			createDivs(chartIndex);
		}
		else 	// the divs already exist, but we need to turn the "Redraw Graph" button back into a "edit graph" button
		{
			document.getElementById("dashboard"+ chartIndex + "_dataControl").setAttribute("style", "display: none");
			var button = document.getElementById("editGraph" + chartIndex);
			button.value = "Edit Graph";
			button.onclick = function () { openGraphEditPane(chartIndex) };
			newChart = false;
		}

		if (displayTheseIndexes.length < 1) {
			alert("You must select at least 1 thing to display");
			return;
		}

		var dashboard = new google.visualization.Dashboard(document.getElementById(chartDivID));

		var control = new google.visualization.ControlWrapper({
			'controlType': 'ChartRangeFilter',
			'containerId': chartDivID + '_scrollBar',
			'options': {
				// Filter by the date axis.
				'filterColumnIndex': 0,
				'ui': {
					'chartType': 'LineChart',
					'chartOptions': {
						'chartArea': {'width': '75%', 'height': '100%'},
						'hAxis': {'baselineColor': 'none'}
					},
					chartView: {
						columns: displayTheseIndexes
					}
				}
			}
		});

		var chart = new google.visualization.ChartWrapper({
			'chartType': 'LineChart',
			'containerId': chartDivID + '_chart',
			'options': {
				'chartArea': {'height': '80%', 'width': '80%'},
				'hAxis': {'slantedText': true},
				'legend': {position: 'right'}
			},
			view: {
				columns: displayTheseIndexes
			}
		});

		dashboard.bind(control, chart);
		dashboard.draw(logging_data_table);		

		controlBars[chartIndex] = control;
		dashboards[chartIndex] = dashboard;
    }
		
	function initDataTable() {
		///// 
		//		put all of this crap in its own method, called when initPage() is called
		// 		stick all of this in a global variable and pass it to the global toolbar. Then 
		// 		pass in the column #s as usual to the individual charts.
		/////
		
		logging_data_table = new google.visualization.DataTable();
		logging_data_table.addColumn('number', 'timestamp');
		logging_data_table.addColumn({type: 'string', role: 'annotation'});
		logging_data_table.addColumn({type: 'string', role: 'annotationText'});
		for (var i = 1;i < logging_data[0].length;i++) {	// add headers
			logging_data_table.addColumn('number', logging_data[0][i]);
			logging_data_table.addColumn({type: 'string', role: 'tooltip'});
		}

		var anArray, timestamp;
		var annotationIndex = 0;
		for (var i = 1;i < logging_data.length;i++) {   // each row
			anArray = new Array();
			anArray.push(logging_data[i][0]);
			// somewhat convoluted: the timestamp on an annotation will never exactly match up with a status update
			// but since they are in order, if the current timestamp is past the current annotation, we know it happened
			// in the last time step and can just put it here.
			if (annotationIndex < annotations.length && annotations[annotationIndex][0] <= logging_data[i][0]) {
					anArray.push(annotations[annotationIndex][1].charAt(0));
					anArray.push(annotations[annotationIndex][1]);
					annotationIndex++;
			}
			else {
					anArray.push('');
					anArray.push('');
			}
			timestamp = MStoTimestamp(logging_data[i][0])
			for (var eachColumn = 1; eachColumn < logging_data[i].length; eachColumn++) {   // each column
				anArray.push(logging_data[i][eachColumn]);
				tooltip = timestamp + "\n" + logging_data[0][eachColumn] + ": " + Math.floor(logging_data[i][eachColumn] * 100) / 100;
				anArray.push(tooltip);
			}
			logging_data_table.addRow(anArray);
		}
	
		initPage(); 	// call it from here to be sure the data table is fully constructed before we try and use it
	}
	
	function assembleHeaderSearchStrings(parameter) {		
		var parameterArray = parameter.split("_");
		var outerSearchString = parameterArray[0];
		for (var i = 1;i < parameterArray.length - 1;i++) {
			outerSearchString += " " + parameterArray[i];
		}		
		return [ outerSearchString, parameterArray[parameterArray.length - 1] ];
	}

	function encode(jsonObj) {
		return encodeURIComponent(jsonObj).replace(/'/g,"%27").replace(/"/g,"%22");
	}

	function decode(encodedStr) {
		return decodeURIComponent(encodedStr.replace(/\+/g, " ").replace(/_/g, " "));
	}
	
	function addChart() {
		var keys = Object.keys(chartDict);
		keys.sort();
		var newKey = keys[keys.length - 1] + 1;
		chartDict[newKey] = [];
		createDivs(newKey);
	}

	}		
		
	function drawHeaderTable() {
		header_visualization.draw(google.visualization.arrayToDataTable(header_data), null);
	}
	
	function fillCurrentSelectionsWindow(chartIndex) {
		var data = new google.visualization.DataTable();
		data.addColumn('string', 'Current Selections');
		data.addColumn('boolean', 'Remove?');
		for (var i = 0; i < chartDict[chartIndex].length;i++) {
			data.addRow( [ chartDict[chartIndex][i], false ] );	
		}

		var table = new google.visualization.Table(document.getElementById("dashboard" + chartIndex.toString() + "_currentSelections"), {"sort": "disable"});
		table.draw(data);
		google.visualization.events.addListener(table, 'select', function () { selectHandler(table, chartIndex, "currentSelections" ) } );
	}

	function openGraphEditPane(chartIndex) {
		thisDataControl = document.getElementById("dashboard" + chartIndex + "_dataControl");
		thisDataControl.setAttribute("style", "display: inline;");
		
		// outer_column selection table
		var data = new google.visualization.DataTable();
        data.addColumn('string', 'Categories');
		
		var temp = []
		for (var i = 0; i < outer_headers.length; i++) {
			temp.push([ outer_headers[i][0] ] );
			data.addRow([ outer_headers[i][0] ]) ;
		}
		var table = new google.visualization.Table(document.getElementById("dashboard" + chartIndex.toString() + "_dataControlLeft"), {"sort": "disable"});
        table.draw(data);
		google.visualization.events.addListener(table, 'select', function () { selectHandler (table, chartIndex, "outer") } );
		
		// right-most, current selections window
		fillCurrentSelectionsWindow(chartIndex);
				
		// turn "edit graph" button into redraw graph button
		var button = document.getElementById("editGraph" + chartIndex);
		button.value = "Redraw Graph";
		button.onclick = function() { drawVisualization(chartIndex) };
	} 
	
	function selectOuter(elementChosen, chartIndex, selection) {
		var start = outer_headers[selection][1];
		var end = outer_headers[selection][2];

		var data = new google.visualization.DataTable();
        data.addColumn('string', 'Data');
		for (var i = start; i <= end; i++) {			
			data.addRow([ logging_data[0][i] ]) ;
		}

		var table = new google.visualization.Table(document.getElementById("dashboard" + chartIndex.toString() + "_dataControlRight"), {sort: "disable"});
		table.draw(data);
		google.visualization.events.addListener(table, 'select', function () { selectHandler (table, chartIndex, "inner", elementChosen) } );
    }
	
	function selectInner(elementChosen, chartIndex, selection, parentElement) {				
		var parentIndex = parentElement.getSelection()[0].row;
		var startOffset = outer_headers[parentIndex][1];		
		var headerIndex = selection + startOffset;

		// selection_innerHeaderIndex should now equal the place in the inner_header array where this thing is. We need 
		// to find its location in logging_data[0], then we can toggle it on or off
		var theHeader = logging_data[0][headerIndex];
		for (var i = 0; i < chartDict[chartIndex.toString()].length; i++) {
			if (theHeader == chartDict[chartIndex.toString()][i]) {
				//chartDict[chartIndex].splice(i,1);					// currently it is really easy to generate more than one selection event
																		// with googles table, causing things to be added and removed when the
																		// user doesn't expect it. So I removed the ability to delete elements by 
																		// clicking on them in the right-most selection pane.
																		// uncomment this line to restore that functionality.
				return;	
			}
		}
		chartDict[chartIndex.toString()].push(theHeader);
		return;
	}
	
	function selectHandler(elementChosen, chartIndex, outerFlag, parentElement) {
		parentElement = parentElement || null;
		var selection = elementChosen.getSelection();
		var row_clicked;
		var message = '';
		for (var i = 0; i < selection.length; i++) {
			var item = selection[i];
			if (item.row != null) {
				if (outerFlag == "outer") {
					selectOuter(elementChosen, chartIndex, item.row);
				}
				else if (outerFlag == "inner") {
					selectInner(elementChosen, chartIndex, item.row, parentElement);
					fillCurrentSelectionsWindow(chartIndex);
				}
				else if (outerFlag == "currentSelections") {
					//if (item.col == "1") { 							// for some reason google table now refuses to return which column....
						chartDict[chartIndex.toString()].splice(item.row, 1);
						fillCurrentSelectionsWindow(chartIndex);
					//}
				}
			}
		}
    }
	
	function setAllStates () {
		var state = globalControlBar.getState();
		var keys = Object.keys(controlBars);
		for (var i = 0;i < keys.length;i++) {
			controlBars[keys[i]].setState(state);
			dashboards[keys[i]].draw(logging_data_table);
		}
	}
	
	function setAllOtherRanges(chartIndex) {
		var state = controlBars[chartIndex].getState();
		
		var gcbstate = globalControlBar.getState();
		
		globalControlBar.setState(state);
		globalControlBar.draw(logging_data); // this must be drawn with the base data table, not the constructed one
		
		var keys = Object.keys(controlBars);
		for (var i = 0;i < keys.length;i++) {
			controlBars[keys[i]].setState(state);
			dashboards[keys[i]].draw(logging_data_table);
		}			
	}		
			
	function deleteChart(chartIndex) {
		var chartDivID = "dashboard" + chartIndex;
		delete chartDict[chartIndex.toString()];
		document.getElementById("chartArea").removeChild(document.getElementById(chartDivID));
		delete controlBars[chartIndex.toString()];
		delete dashboards[chartIndex.toString()];
	}
	
	function exportViewData(chartIndex, onlyThisOneFlag) {
		var allViewedFields = {};
		allViewedFields.selections = "";
		for (var i = 0;i < chartDict[chartIndex].length;i++) {
			allViewedFields.selections += chartDict[chartIndex.toString()][i].replace(/ /g, "_") + ",";
		}
		allViewedFields.selections = (allViewedFields.selections).substring(0, allViewedFields.selections.length - 1);
		
		if (onlyThisOneFlag == true) {
			var allViewedFieldsWrapper = {};
			allViewedFieldsWrapper['1'] = {};
			allViewedFieldsWrapper['1'] = allViewedFields;
			var address = window.location.href;
			var addressSplit = address.split("?");
			allViewedFields = addressSplit[0] + "?" + encode(JSON.stringify(allViewedFieldsWrapper));
			
			document.getElementById("putViewedFieldsHere" + chartIndex).value = allViewedFields;
			document.getElementById("putViewedFieldsHere" + chartIndex).style.display = "inline";
		}
		else {
			return allViewedFields;
		}
	}

	function saveAllCharts() {
		var allViews = {};
		var pointlesshack = Object.keys(chartDict);
		for (var i = 0;i < pointlesshack.length;i++) {
			var index = pointlesshack[i].toString();
			allViews[index] = {};
			allViews[index] = exportViewData(index, false);
		}
		
		var address = window.location.href;
		var addressSplit = address.split("?");
		allViewedFields = addressSplit[0] + "?" + encode(JSON.stringify(allViews));
			
		document.getElementById("putAllViewedFieldsHere").value = allViewedFields;
		document.getElementById("putAllViewedFieldsHere").style.display = "inline";			
	}
  </script>
